prog:
// See the play button in the top right? It looks like a black triangle.
// Hit that to get started!
//
// CHALLENGE 2: The knight is falling. Wouldn't it be fun if he fell on the spike?
//              Hit play to make him fall again.
//
//              Read through the code below and try changing the numbers to make
//              the knight fall on the spike.
//

/* BEGIN TEXT */
const e = createEngine(gameCanvas, 300, 300);

e.addText("why let him fall forever", 178, 93, { size: 15 });
e.addText("when you could make things", 178, 110, { size: 13 });
e.addText("interesting", 173, 129, { size: 24 });

e.addText("^", 51, 274);
e.addText("|", 51, 280);
e.addText("move the spike here!", 94, 296);
/* END TEXT */

/* BEGIN KNIGHT */
e.add({
  sprite: knight,
  solid: true,
  scale: 4,
  update: (me) => {
    me.vy += 20;
  }
})
/* END KNIGHT */

/* BEGIN SPIKE */
e.add({
  sprite: spike,
  scale: 3,
  y: 191,
  x: 236,
  collides(me, them) { e.remove(them) }
})
/* END SPIKE */

e.start();
